import React from "react";

function Navbar() {
  return (
    <div>
      <div class="topnav">
        <a href="#home" class="active">
          Logo
        </a>

        <div id="myLinks">
          <a href="#news">News</a>
          <a href="#contact">Contact</a>
          <a href="#about">About</a>
        </div>

        <a href="javascript:void(0);" class="icon" onclick="myFunction()">
          <i class="fa fa-bars"></i>
        </a>
      </div>
    </div>
  );
}

export default Navbar;
